// level 1 - normal right menu item
// level 2 - dropdown menu item
// level 3 - normal left menu item
import clothes from '../../../img/clothes.jpg'
import students from '../../../img/students.jpg'
import friends from '../../../img/friends.jpg'
import soldure from '../../../img/soldure.jpg'

export const Indicators = [
  {
    dataTarget: '#myCarousel',
    num: '0',
    iClass: 'active',
  },
  {
    dataTarget: '#myCarousel',
    num: '1',
    iClass: '',

  },
  {
    dataTarget: '#myCarousel',
    num: '2',
    iClass: '',
  },
  {
    dataTarget: '#myCarousel',
    num: '3',
    iClass: '',
  }
]

export const Items = [
  {
    cItem: 'carousel-item active',
    src: {clothes},
    imgAlt: 'clothes',
  },
  {
    cItem: 'carousel-item',
    src: {students},
    imgAlt: 'students',
  },
  {
    cItem: 'carousel-item',
    src: {friends},
    imgAlt: 'friends',
  },
  {
    cItem: 'carousel-item',
    src: {soldure},
    imgAlt: 'soldure',
  }
]
